/*
  *模板过滤器
*/
var conversionTime = function (data, format) {
    if (!data) {
        return
    }
    
    var date = new Date(data);  //获取的data是时间是格式 2018-12-10 12：12：00
   // var date = new Date(parseInt(data)); //获取的data是时间截
    var year = date.getFullYear();
    var month = (date.getMonth() + 1)<10?"0"+(date.getMonth() + 1):date.getMonth() + 1;
    var day = date.getDate()<10?"0"+date.getDate():date.getDate();
    var hours = date.getHours()<10?"0"+date.getHours():date.getHours();
    var minutes = date.getMinutes() < 10 ? "0" + date.getMinutes() : date.getMinutes();
    var seconds = date.getSeconds();
    !format ? format = 'yyyy.MM.dd hh:mm:ss' : format;
    var n;
  
    switch (format) {
        case 'yyyy':
        n = year;
        break;
    case 'MM':
        n = month;
        break;
    case 'dd':
        n = day;
        break;
    case 'yyyy-MM-dd hh:mm:ss':
        n = year + '-' + month + '-' + day + ' ' + hours + ':' + minutes +':' + seconds;
        break;
    case 'yyyy-MM-dd':
        n = year + '-' + month + '-' + day;
        break;
    case 'yyyy-MM':
        n = year + '-' + month;
            break;
    case "yyyy/MM/dd hh:mm:ss":
        n = year + '/' + month + '/' + day + ' ' + hours + ':' + minutes + ':' + seconds;
            break;
    case 'yyyy/MM/dd hh:mm':
        n = year + '/' + month + '/' + day + ' ' + hours + ':' + minutes;
        break;
    case 'yyyy/MM':
        n = year + '/' + month;
        break;
    case 'yyyy/MM/dd':
        n = year + '/' + month + '/' + day;
        break;
    case 'yyyy.MM':
        n = year + '.' + month;
        break;
    case 'yyyy.MM.dd hh:mm':
        n = year + '.' + month + '.' + day + ' ' + hours + ':' + minutes;
        break;
    case 'yyyy.MM.dd':
        n = year + '.' + month + '.' + day;
        break;
    case 'yyyy年MM月dd日 hh:mm':
        n = year + '年' + month + '月' + day + '日 ' + hours + ':' + minutes;
        break;
    case 'yyyy年MM月dd日':
        n = year + '年' + month + '月' + day+'日';
        break;

    };
    return n
};
