/**
 *Ajax交互方法
 */
(function ($) {
 
    function Ajax(source, opts) {
        var self = this;
        var s = $(source);
        var t = s[0];
        var nodeName = t.nodeName;
        var data;
        var opts = $.extend({}, Ajax.DEFAULT, opts);
        if (nodeName && nodeName !== 'FORM') {
            throw "_Ajax方法只能FORM表单或者JS对象调用";
        }
        data = nodeName === 'FORM' ? decodeURIComponent(s.serialize(), true) : t;
        //特殊情况添加参数
        if (typeof data ==='object'&&opts.data) {
            data = $.extend(data,opts.data)
        } else if (typeof data === 'string' && opts.data) {
            var str = '';
            $.each(opts.data, function (i, v) {
                        str += i + '=' + v + '&';
            });
            str = str.substr(0, str.length - 1);
            data =data + '&' + str
        }
        data = this.getData(opts.contentType, data)
        this.jqAjax(opts, data)
    }

  

    Ajax.DEFAULT = {
        host: api.host, //服务器地址
        url: '', //请求的地址       (必填)
        data:null,
        type: 'GET', //请求的方法
        contentType: 'form', //请求的内容类型   (可选 'json' )
        dataType: 'json', //请求的内容类型   (可选 'json' )
        async: true, //是否异步
        xhrFields: {withCredentials: true},
        crossDomain: true,
        loadTarget: '', //loadding
        success: { //简单的请求       (如果传回掉函数，则和jQ用法一样)
            msg: null, //成功提示信息
            hide: null //需要关闭的静态框
        },
        error: function (data) { //失败回调函数
            toastr.error('请求没有成功');
        }
    };

    Ajax.prototype = {
        getData: function (contentType, d) {
            var data;
            if (contentType === 'json') {
                if (typeof d === 'string') {
                    var arr = d.split('&');
                    data = {};
                    $.each(arr, function (i, v) {
                        var arr = v.split('=');
                        data[arr[0]] = arr[1];
                    });
                    data = JSON.stringify(data);
                } else {
                    data = JSON.stringify(d);
                }
            } else {
                if (typeof d === 'object') {
                    var str = '';
                    $.each(d, function (i, v) {
                        str += i + '=' + v + '&';
                    });
                    str = str.substr(0, str.length - 1);
                    data = str
                } else {
                    data = d;
                }
            }
            return data;
        },
        jqAjax: function (opts, data) {
        
            var sFN, eFN;
            if (!opts.loadTarget) {
                opts.loadTarget = 'body';
            }
            opts.type = "POST";
            var contentType = opts.contentType;

            if (contentType === 'json') {
                contentType = 'application/json;charset=utf-8';
            } else {
                contentType = 'application/x-www-form-urlencoded;charset=utf-8';
            }
            if (typeof opts.success === 'function') {
                sFN = function (data) {
                    hideLoad(opts.loadTarget);
                    opts.success(data);
                }
            } else {
                sFN = function (data) {
                    hideLoad(opts.loadTarget);
                    if (data.code === 0) {
                        toastr.success(opts.success.msg);
                    } else {
                        toastr.error(data.message);
                    }
                }
            }
            eFN = function (data) {
                hideLoad(opts.loadTarget);
                opts.error(data);
            };
            showLoad(opts.loadTarget, '99999999999');
            var url = (opts.host ? opts.host : api.host) + opts.url;
            $.ajax({
                type: opts.type,
                url: url,
                data: data,
                contentType: contentType,
                dataType: opts.dataType,
                async: opts.async,
                xhrFields: {withCredentials: true},
                crossDomain: true,
                success: sFN,
                error: eFN
            })
        }
    };
    $.fn.extend({
        _Ajax: function (opts) {
            new Ajax(this, opts);
            return this;
        }
    });



})(jQuery);






// 转为unicode 编码
function encodeUnicode(str) {
    var res = [];
    for ( var i=0; i<str.length; i++ ) {
    res[i] = ( "00" + str.charCodeAt(i).toString(16) ).slice(-4);
    }
    return "\\u" + res.join("\\u");
}

// 解码
function decodeUnicode(str) {
    str = str.replace(/\\/g, "%");
    return unescape(str);
}


